  \"2015-01-22T15:57:46.927335\",\n\t\"name\": \"hud-insured-hospitals\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Office of Healthcare Programs (OHP),
  previously known as the Office of Insured Health Care Facilities, is located within
  the Office of Housing and administers the FHA healthcare program, the Section 242
  Mortgage Insurance for Hospitals. This program enables the affordable financing
  and refinancing of healthcare facility projects nationwide. FHA's healthcare programs
  are integral to HUDu0092s community development mission. By reducing the cost of
  capital needed by hospitals to finance the construction, renovation, acquisition,
  or refinancing of facilities, this program improves access to quality healthcare
  and work to decrease overall healthcare costs. To learn more about the Section 242
  Mortgage Insurance for Hospitals program, please visit the following website: http://portal.hud.gov/hudportal/HUD?src=/federal_housing_administration/healthcare_facilities/section_242\",\n\t\"license_title\":
